    false,nt"url": null,nt"notes": "This annual narrative report for Kodiak
    NWR outlines Refuge accomplishments during the 1992 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning,
    public participation, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, volunteer programs, funding, safety, and technical assistance is
    given. The wildlife section of the report discusses waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, and fisheries resources. The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive programs,
    hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, and computer
    systems. Cooperative programs and economic uses of the Refuge are provided at the
